    if mibBuilder.loadTexts: ciscoDocsExtMIB.setRevisionsDescriptions(('Added following tables: cdxCpeIpPrefixTable cdxCmtsMtcCmTable cdxCmtsUscbSflowTable Added following OBJECT-GROUPs: cdxCpeIpPrefixGroup cdxCmtsMtcCmGroup cdxCmtsUscbSflowGroup', 'Add the following mib groups: cdxWBResilGroup, cdxNotifGroupExt, cdxQosCtrlGroupExt, cdxDownstreamGroup', 'Add new object cdxCmCpeDeleteNow to cdxCmCpeTable to delete the cable modems.', 'Following tables are added. cdxCmToCpeTable cdxCpeToCmTable These are used for the direct correlation between Cable Modem and Customer Premises Equipment.', 'Modified the description of cdxCmtsServiceExtEntry. Modified the value of lockingMode from 2 to 3.', "Modified dxCmtsCmDefaultMaxCpes' lower range from 0 to -1.", 'Added new objects for supporting DMIC. The objects are cdxCmtsCmDMICMode, cdxCmtsCmDMICLockQos and a new table cdxCmtsCmStatusDMICTable. Also, one more trap, cdxCmtsCmDMICLockNotification is added. Two more states were added to cdxCmtsCmStatusValue.', 'Added new object cdxCmtsCmQosProfile to cdxCmtsCmTable to associate a cable modem with a qos profile.', 'Added new objects cdxIfCmtsCmStatusOnlineTimesNum and cdxIfCmtsCmStatusLastResetTime to cdxCmtsCmStatusExtTable.', 'DOCSIS 1.1 Changes: Added new objects cdxIfUpChannelAvgUtil, cdxIfUpChannelAvgContSlots, cdxIfUpChannelRangeSlots in cdxIfUpstreamChannelExtTable. NON-DOCSIS 1.1 Changes: Added following objects in cdxIfUpstreamChannelExtTable for providing per upstream UGS statistics information: cdxIfUpChannelNumActiveUGS, cdxIfUpChannelMaxUGSLastOneHour, cdxIfUpChannelMinUGSLastOneHour, cdxIfUpChannelAvgUGSLastOneHour, cdxIfUpChannelMaxUGSLastFiveMins, cdxIfUpChannelMinUGSLastFiveMins, cdxIfUpChannelAvgUGSLastFiveMins.', 'DOCSIS 1.1 Changes: 1. Added cdxUpInfoElemStatsTable to display the per Information Element (IE) statistics. 2. Added the new queue types in cdxBWQueueNameCode to support the new priority queues of the MAC-Scheduler. 3. Added the new CM states in cdxCmtsCmStatusValue. Non-DOCSIS 1.1 changes: 4. Added new status information for CM if the connection is noisy or if the maximum power has been reached. 5. Changed the Description for cdxIfUpChannelWidth to cater for non-awacs card. 6. Added new object cdxIfUpChannelInputPowerLevel for Upstream Input Power Level.', '1. Added cdxCmtsCmTotal,cdxCmtsCmActive, cdxCmtsCmRegistered to the cdxCmtsMacExtTable to report the number of active,registered,total cable modems on a cable mac interface since boot. 2. Added cdxIfUpChannelCmTotal, cdxIfUpChannelCmActive, cdxIfUpChannelCmRegistered to the cdxIfUpstreamChannelExtTable to report the number of active,registered,total cable modems connected on an upstream.', '1. Added cdxCmCpeResetNow to reset CM or CPE. 2. Added cdxCmtsCmCurrCpeNumber to report the current number of CPE connecting to the CM.', '1. Added new objects cdxSpecMgmtObjects. 2. Added new object cdxIfCmtsCmStatusDynSidCount. 3. Enhanced cdxQosIfRateLimitTable for a new rate limit algorithm. 4. Added more status for cdxCmtsCmStatusValue.', 'Initial version of this MIB module.',))
