if mibBuilder.loadTexts: cdxQosCtrlUpAdmissionCtrl.setDescription("The admission control status for minimum guaranteed upstream bandwidth scheduling service requests for this upstream. When this object is set to 'true', if there is a new modem with minimum guaranteed upstream bandwidth scheduling service in its QoS class requesting to be supported in this upstream, the upstream scheduler will check the virtual reserved bandwidth remaining capacity before giving admission to this new modem. If there is not enough reserved upstream bandwidth to serve the modem's minimum guaranteed bandwidth, the registration request will be rejected. This object is set to 'false' to disable admission control. That is, there will be no checking for bandwidth capacity and the upstream interface scheduler just admits modem registration requests. This object is not meant for Unsolicited Grant Service(UGS) scheduling service as admission control is a requirement in this case.")
