if mibBuilder.loadTexts: cdxUpInfoElemStatsNameCode.setDescription("This entry describes the Information Element (IE) type. Enumerations are : reqIE(1) : Request Information Element, The request Information Element provides an upstream interval in which a CM can request the CMTS for bandwidth on the upstream channel. reqOrDataIE(2) : Request/Data Information Element, The Request/data Information Element provides an upstream interval in which request may be made by the CM to the CMTS for bandwidth or short data packets may be transmitted on the upstream channel. initMtnIE(3) : Initial Maintenance Information Element , The Initial Maintenance Information Element provides an interval in which new stations may join the network. stnMtnIE(4) : Station Maintenance Information Element , The Station Maintenance Information Element provides an interval in which stations are expected to perform some aspect of routine network maintenance, such as ranging or power adjustment. shortGrantIE(5) : Short Data Grant Information Element, Short data grant Information Element provides the CM an opportunity to transmit one or more upstream PDU's. Short data grants are used with intervals equal to or less than the maximum burst size for the usage specified in the Upstream Channel Descriptor. longGrantIE(6) : Long Data Grant Information Element, The long data grant Information Element also provides the CM an opportunity to transmit one or more upstream PDU's. All long data grant Information Elements must have a larger number of mini-slots than that defined for a short data grant Information Element profile defined in the Upstream Channel Descriptor.")
