if mibBuilder.loadTexts: cdxBWQueueNameCode.setDescription("The name code for the queue. cirQ :CIR queue. The queue is for Committed Information Rate (CIR) type of service which serves Service IDs which have minimum guaranteed rate in its QoS profile. It is applicable if CMTS is running is either of DOCSIS 1.0 or 1.1 modes. For DOCSIS 1.1 it has priority 8. tbeQ :TBE Queue. The queue is for TIERED BEST EFFORT type service which serves Service IDs which does not have minimum guaranteed rate in its QoS profile. It is only applicable if CMTS is running in DOCSIS 1.0 mode. p0BEGrantQ-p7BEGrantQ : BEST EFFORT Queue The queues p0BEGrantQ to P7BEGrantQ are for TIERED BEST EFFORT type service which serves Service IDs which do not have minimum guaranteed rate specified in the QoS parameters. P0 has lowest priority and P7 has highest. Best Effort type is purely handled with prioritization in FIFO's and hence demands more number of queues. These queues are applicable only if CMTS is running under mode DOCSIS 1.1. rngPollQ : RngPoll queue. The queue is for the ranging SID's. It has the highest priority. This queue information is only provided if CMTS is running under mode DOCSIS 1.1.")
