if mibBuilder.loadTexts: cdxCmtsCmOnOffTrapInterval.setDescription('The interval for cdxCmtsCmOnOffNotification sent by CMTS for one online/offline state change if cdxCmtsCmOnOffTrapEnable is true. If there are more than one state changes to online/offline for a cable modem during this interval, only one cdxCmtsCmOnOffNotification is sent by CMTS for the first state change to online and one cdxCmtsCmOnOffNotification for the first state changing to offline if cdxCmtsCmOnOffTrapEnable is true. This is to avoid too many notifications sent for a cable modem online/offline state changes during a short period of time. If the value is 0, then cdxCmtsCmOnOffNotification will be sent for every state changes to online/offline for a cable modem if cdxCmtsCmOnOffTrapEnable is true. If cdxCmtsCmOnOffTrapEnable value changes from true to false or from false to true, this value will remain no change as before. The default value is 600 seconds.')
