cdxCmtsCmDMICMode = MibTableColumn((1, 3, 6, 1, 4, 1, 9, 9, 116, 1, 3, 3, 1, 7), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4))).clone(namedValues=NamedValues(("notConfigured", 1), ("mark", 2), ("lock", 3), ("reject", 4))).clone('mark')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: cdxCmtsCmDMICMode.setStatus('current')
if mibBuilder.loadTexts: cdxCmtsCmDMICMode.setDescription('The Dynamic Shared Secret feature can operate in three different modes, depending on what action should be taken for cable modems that fail the CMTS MIC verification check: notConfigured(1): It indicates that the DMIC is not configured for this cable interface. mark(2): By default, the Dynamic Shared Secret feature is enabled on all cable interfaces using the mark option. In this mode, the CMTS allows cable modems to come online even if they fail the CMTS MIC validity check. However, for this modem cdxCmtsCmStatusDMICMode will be labeled as marked. lock(3): When the lock option is used, the CMTS assigns a restrictive QoS configuration to CMs that fail the MIC validity check twice in a row. A particular QoS profile to be used for locked cable modems can be specified by setting cdxCmtsCmDMICLockQos. If a customer resets their CM, the CM will reregister but still uses the restricted QoS profile. A locked CM continues with the restricted QoS profile until it goes offline and remains offline for at least 24 hours, at which point it is allowed to reregister with a valid DOCSIS configuration file. A system operator can manually clear the lock on a CM by setting cdxCmtsCmStatusDMICUnLock object. reject(4): In the reject mode, the CMTS refuses to allow CMs to come online if they fail the CMTS MIC validity check.')
cdxCmtsCmDMICLockQos = MibTableColumn((1, 3, 6, 1, 4, 1, 9, 9, 116, 1, 3, 3, 1, 8), Integer32().subtype(subtypeSpec=ValueRangeConstraint(1, 16383))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: cdxCmtsCmDMICLockQos.setStatus('current')
if mibBuilder.loadTexts: cdxCmtsCmDMICLockQos.setDescription('If cdxCmtsCmDMICMode is set to lockingMode(3), this object would contain the restrictive QoS profile number as indicated by docsIfQosProfIndex if set and it will have 0 if not applicable or not defined. In case, cdxCmtsCmDMICMode is set to lockingMode(3) and this object is not defined then the CMTS defaults to special QoS profile that limits the downstream and upstream service flows to a maximum rate of 10 kbps. However, for this to happen the modems should have the permission to create QoS profile.')
