if mibBuilder.loadTexts: cdxCmtsCmChOverTimeExpiration.setStatus('current')
if mibBuilder.loadTexts: cdxCmtsCmChOverTimeExpiration.setDescription('The time period to expire a CMTS channel override operation. Within the time period, if the CMTS cannot send out a RNG-RSP message with channel override fields to a cable modem specified in the operation, the CMTS will abort the operation. The possible reason is that the cable modem does not repeat the initial ranging. The change to this object will not affect the already active operations in this cdxCmtsCmChOverTable. Once the operation completes, the management station should retrieve the values of the cdxCmtsCmChOverState object of interest, and should then delete the entry from cdxCmtsCmChOverTable. In order to prevent old entries from clogging the table, entries will be aged out, but an entry will never be deleted within 15 minutes of completing.')
cdxCmtsCmChOverTable = MibTable((1, 3, 6, 1, 4, 1, 9, 9, 116, 1, 3, 5), )
