if mibBuilder.loadTexts: cdxCmtsCmChOverTable.setDescription('A table of CMTS operation entries to instruct cable modems to move to a new downstream and/or upstream channel. An entry in this table is an operation that has been initiated from CMTS to generates downstream frequency and/or upstream channel override fields in the RNG-RSP message sent to a cable modem. A RNG-RSP message is sent to a cable modem during initial maintenance opportunity. This operation causes the uBR to place an entry for the cable modem specified into the override request queue. The link is then broken by deleting the modem from its polling list. When the modem attempts initial ranging, the override request causes downstream frequency and upstream channel override fields to be inserted into the RNG-RSP message.')
cdxCmtsCmChOverEntry = MibTableRow((1, 3, 6, 1, 4, 1, 9, 9, 116, 1, 3, 5, 1), ).setIndexNames((0, "CISCO-DOCS-EXT-MIB", "cdxCmtsCmChOverSerialNumber"))
if mibBuilder.loadTexts: cdxCmtsCmChOverEntry.setReference('Data-Over-Cable Service Interface Specifications (DOCSIS) Radio Frequency Interface Specification (SP-RFI-I04-980724) , 6.3.2.5.3 Overriding Channels.')
if mibBuilder.loadTexts: cdxCmtsCmChOverEntry.setStatus('current')
if mibBuilder.loadTexts: cdxCmtsCmChOverEntry.setDescription("A CMTS operation entry to instruct a cable modem to move to a new downstream and/or upstream channel. A CMTS operator can use this to initiate an operation in CMTS to instruct a cable modem to move to a new downstream, or upstream channel or both. Each entry consists of the mac address of the cable modem to be moved, a new downstream frequency, a new upstream channel id etc.. More than one entries could have for a cable modem, so there is a time stamp for each entry to show the time when this operation is initiated. A management station wishing to create an entry should first generate a pseudo-random serial number to be used as the index to this sparse table. The station should then create the associated instance of the row status object. It must also, either in the same or in successive PDUs, create the associated instance of the command and parameter objects. It should also modify the default values for any of the parameter objects if the defaults are not appropriate. Once the appropriate instances of all the command objects have been created, either by an explicit SNMP set request or by default, the row status should be set to active to initiate the operation. Note that this entire procedure may be initiated via a single set request which specifies a row status of createAndGo as well as specifies valid values for the non-defaulted parameter objects. Once an operation has been activated, it cannot be stopped. That is, it will run until either the CMTS has generated downstream frequency and/or upstream channel override fields in the RNG-RSP message sent to a cable modem or time out. In either case, the operation is completed. Once the operation is completed, the real result of the operation to the cable modem cannot be known from this table. The result of the cable modem's downstream frequency and the upstream channel id can be checked from other MIB tables. For example, docsIfCmtsServiceTable from DOCS-IF-MIB can be used to check whether the cable modem's downstream frequency and upstream channel id are changed. Please note that even the CMTS has generated downstream frequency and/or upstream channel override fields in the RNG-RSP message sent to a cable modems, if the cable modem cannot lock the instructed downstream frequency or no upstream channel id could be used, it may reconnect back to the original downstream frequency and upstream channel id. Once the operation completes, the management station should retrieve the values of the cdxCmtsCmChOverState objects of interest, and should then delete the entry. In order to prevent old entries from clogging the table, entries will be aged out, but an entry will never be deleted within 15 minutes of completing.")
