if mibBuilder.loadTexts: cdxCmtsCmChOverState.setDescription("The status of the specified channel override operation. The enumerations are: messageSent(1): the CMTS has sent a RNG-RSP message with channel override to the cable modem. commandNotActive(2): the command is not in active mode due to this entry's row status is not in active yet. noOpNeed(3): The downstream frequency and the upstream channel Id in this entry are the same as original ones when this entry's row status is set to active, so CMTS does not need to do any operation. modemNotFound(4): The modem is not found in the CMTS at the time when the command becomes active. waitToSendMessage(5): specified the operation is active and CMTS is waiting to send a RNG-RSP message with channel override to the cable modem. timeOut(6): specified the operation is timed out. That is, the CMTS cannot send a RNG-RSP message with channel override to the cable modem within the time specified in the object of cdxCmtsCmChOverTimeExpiration. The possible reason is that the cable modem does not repeat the initial ranging. The possible state change diagram is as below: [commandNotActive ->] waitToSendMessage -> messageSent or timeOut. [commandNotActive ->] noOpNeeded or modemNotFound.")
